const egg =
  "data:image/png;base64,";

const canvas = document.getElementById("render");
const ctx = canvas.getContext("2d");
const eggImg = document.createElement("img");
function drawEgg() {
  ctx.drawImage(eggImg, 1500 / 2 - eggImg.naturalWidth / 2, 500 / 2);
}
function drawLeftEgg() {
  ctx.drawImage(
    eggImg,
    0,
    0,
    eggImg.naturalWidth,
    eggImg.naturalHeight,
    1500 / 2 - eggImg.naturalWidth / 2,
    500 - eggImg.naturalHeight / 3 + 20,
    eggImg.naturalWidth / 3,
    eggImg.naturalHeight / 3
  );
}
function drawRightEgg() {
  ctx.drawImage(
    eggImg,
    0,
    0,
    eggImg.naturalWidth,
    eggImg.naturalHeight,
    800,
    350,
    eggImg.naturalWidth / 2,
    eggImg.naturalHeight / 2
  );
}
eggImg.src = egg;
eggImg.onload = () => {
  drawEgg();
  drawLeftEgg();
  drawRightEgg();
};

fillBackground();

function fillBackground() {
  ctx.fillStyle = "#67c2aa";
  ctx.rect(0, 0, 1500, 500);
  ctx.fill();
}

function download() {
  var link = document.createElement("a");
  link.download = "cryptokips_codekittens.png";
  link.href = canvas.toDataURL();
  link.click();
}

const btn = document.querySelector("button");
var lastKnownValue = undefined;
btn.onclick = function onclick() {
  const ctx = canvas.getContext("2d");
  const username = document.querySelector("input").value;

  if (lastKnownValue) {
    ctx.clearRect(0, 0, 1500, 500);
    fillBackground();
    drawEgg();
    drawLeftEgg();
    drawRightEgg();
  }

  const { width } = ctx.measureText(username);

  const renderAtX = 1500 / 2 - width / 2;
  const renderAtY = 500 / 2;

  ctx.font = "96px Hero";
  ctx.fillStyle = "white";
  ctx.fillText(username, renderAtX, renderAtY);
  lastKnownValue = username;

  download();
};
